import React, {useEffect,useState} from 'react';
import {Redirect} from 'react-router-dom';
function Home({match}) {
   const [clk,setclk]=useState(false);
    useEffect(()=>{
        console.log({match});
    },[ match])
    return (
        <div>
           <h2>home {match.params.prp} </h2>
            <button onClick={()=> setclk(true)}>root</button> 
            {clk}?<Redirect to="/" />:'';
        </div>
    )
}

export default Home;
